import Home from "./pages/Home";
import Cart from "./pages/Cart";
/* all done just toast not working and we can improve css styling in cart and cart item*/
const App = () => {
  return (

    <div>
     
     <div>
       <Navbar/>
     </div>
     <Routes>
         <Route path = "/" element = {<Home/>} />
         <Route path = "/cart" element = {<Cart/>} />
     </Routes>

    </div>
    
  )
};

export default App;
